//INTERFACE
export interface ITodo {
  id: string | number | Date,
  todo: string
}

//CLASS
export class Todo {
  id: string;
  text: string;

  constructor(todoText: string) {
    this.id = new Date().toISOString();
    this.text = todoText;
  }
}
